import React from "react";
import Card from "@material-ui/core/Card";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faPlusCircle,
  faList,
  faPlay,
} from "@fortawesome/free-solid-svg-icons";

function Layout() {
  return (
    <div className="cards-from-layout">
      <Card className="card-from-layout">
        <FontAwesomeIcon
          icon={faPlusCircle}
          size="3x"
          className="icons-from-layout"
        />
        <h1>Manage my Brands</h1>
      </Card>
      <Card className="card-from-layout">
        <FontAwesomeIcon icon={faPlay} className="icons-from-layout" />
        <h1>Manage my Campaigns</h1>
      </Card>
      <Card className="card-from-layout">
        <FontAwesomeIcon icon={faList} className="icons-from-layout" />
        <h1>Manage my budget</h1>
      </Card>
    </div>
  );
}
export default Layout;
